import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';
import { Redirect } from 'react-router-dom';

class SellerLogin extends Component {
    // postLogins = function () {
    //     this.props.postLogin().then(
    //         () => {
    //             this.props.history.push("/profile");
    //         }
    //     )
    // };

    render() {
        return (
            <section>
                <div class="container-fluid my-5">
                    <div class="row">
                        <div class="col-12 col-md-4"></div>
                        <div class="col-12 col-md-4">
                            <div class="card box-signin px-3">
                                <h2 class="mt-3">Please Sign In</h2>
                                <hr />
                                <article class="card-body">
                                    <a href="signup.html" class="float-right btn blue-btn">Sign up</a>
                                    <h4 class="card-title mb-4 mt-1"><strong>Sign In as Seller</strong></h4>
                                    <form>
                                        <div class="form-group">
                                            <label>Your email</label>
                                            <input name="" class="form-control" placeholder="Email" type="email" />
                                        </div>
                                        <div class="form-group">
                                            <a class="float-right forgot" href="#">Forgot?</a>
                                            <label>Your password</label>
                                            <input class="form-control" placeholder="******" type="password" />
                                        </div>
                                        <div class="form-group">
                                            <div class="checkbox">
                                                <label><input type="checkbox" /> Save password </label>
                                            </div>
                                        </div>
                                        <div class="form-group">
                                            <button type="submit" class="btn blue-btn btn-block"> Login </button>
                                        </div>
                                    </form >
                                </article >
                            </div>
                        </div>
                        <div class="col-12 col-md-4"></div>
                    </div>
                </div>
            </section>
        );
    }
}

export default withRouter(SellerLogin);
